import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './Home';

export default function App() {
  return (
    <Router>
    <Routes>
      <Route  path="./Home" component={Home} />
    </Routes>
  </Router>
  );
}
